import React, { Component } from "react";
import "./style.css";

class Saida extends Component {

  apagar(){
    const indice = this.props.lista;
    this.props.HandleDelete(indice);
  }

  render() {
    return (
      <section className="saida-container">
        <div className="saida-wrap">
          <ul className="saida-lista">
            {this.props.lista.map((item, index) => (
              <li className="saida-item" key={index}>
                <div>
                  <input
                    className="saida-checkbox"
                    type="checkbox"
                    onClick={this.props.HandleChecked}
                  />
                  <span className={"saida-texto " + this.props.checked}>{item.texto}</span>
                </div>
                <div>
                  <button
                    className="saida-deletar"
                    type="button"
                    onClick={this.props.apagar}
                  >
                    deletar
                  </button>
                </div>
              </li>
            ))}
          </ul>
        </div>
      </section>
    );
  }
}

export default Saida;
